inv2 = pow(2, MOD - 2, MOD)

def logm(n, m):
    ans = 0
    whole = True
    while n >= m:
        whole = whole and n % m == 0
        ans += 1
        n //= m
    if n == 1:
        return (ans, whole)
    return (ans, False)

def fact_exp(n, k):
    ans = 0
    while n != 0:
        n //= k
        ans += n
    return ans

def calculate_birthday_probability(n, k):
    e2 = n + fact_exp(k - 1, 2)
    div = pow(2, n * k - e2, MOD)
    (e, w) = logm(k, 2)
    if e > n or (e == n and (not w)):
        return (1, 1)
    num = 1
    Nr = pow(2, n, MOD)
    for t in range(1, k):
        i = (Nr - t) % MOD
        if i == 0:
            num = 0
            break
        p = 0
        while t % 2 == 0:
            p += 1
            t //= 2
        num = num * i * pow(inv2, p, MOD) % MOD
    A = (div - num) % MOD
    B = div
    return (A, B)

