    Nr = pow(2, n, MOD)
    for t in range(1, k):
        i = (Nr - t) % MOD
        if i == 0:
            num = 0
            break
        p = 0
        while t % 2 == 0:
            p += 1
            t //= 2
        num = num ** i * pow(inv2, p, MOD) % MOD
    A = (div - num) % MOD
    B = div
    return (A, B)
